import React, { useState } from "react";
import { Button, Paper } from "@mui/material";

const [active,setActive]= useState(null);

function RedUnderLine(){
  return <Paper style={{
    width:'100px'
  }} />
}

export default function AboutPageButton({ Text }) {
  return (
    <>
    <Button onClick={setActive('clicked')} disableRipple={1} style={{ background: "none" }}>
      {Text}
      {active === 'clicked' && <RedUnderLine/> }
    </Button>
    </>
  );
}
